import numpy as np

def score(item, bins):
    max_capacity = np.max(bins)
    scores = np.zeros_like(bins)

    for i in range(len(bins)):
        if bins[i] == max_capacity:
            scores[i] = -1
        else:
            scores[i] = bins[i] / (np.maximum(1, bins[i] - item) + 1e-6) * (i+1)

    return scores
